import RaftInstruction, {RaftInstructionParams} from "./base";

export interface ZProbeInstructionParams extends RaftInstructionParams {
    original: string
}

export default class ZProbeInstruction extends RaftInstruction {

    readonly original: string;

    constructor (params: ZProbeInstructionParams) {
        super(params);
        this.original = params.original;
    }

    toString(): string {
        return "ZProbeInstruction";
    }

}
